import React from 'react';

const Creators = () => {
  return (
    <div className="w-[1440px] relative bg-white">

      {/* Main Content */}
      <div className="h-[6136px]">
        <div className="h-[1217px] bg-neutral-50">
          {/* Add your specific sections/content as needed */}
        </div>

        <div className="px-6 pt-20 pb-24 flex flex-col items-center">
          <div className="w-[1248px] h-px bg-gradient-to-r from-white via-slate-200 to-white"></div>
          <div className="w-[1200px] relative">
            <div className="text-slate-400 text-[26.33px] font-semibold leading-[43.88px]">pulse</div>
            <div className="flex justify-between mt-6">
              <div className="text-slate-700 text-sm font-medium">Product</div>
              <div className="text-slate-700 text-sm font-medium">Company</div>
              <div className="text-slate-700 text-sm font-medium">Resources</div>
            </div>
            <div className="flex justify-between mt-6">
              <div className="text-gray-500/opacity-70 text-sm font-medium">Integrations</div>
              <div className="text-gray-500/opacity-70 text-sm font-medium">Pricing</div>
              <div className="text-gray-500/opacity-70 text-sm font-medium">Documentation</div>
            </div>
          </div>
        </div>
      </div>

    </div>
  );
};

export default Creators;
